import{_ as a,c as s,o as n,ag as t}from"./chunks/framework.Ds6Eueu6.js";const h=JSON.parse('{"title":"EXPLAIN","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/EXPLAIN.md","filePath":"docs/7x/ref_guide/sql_commands/EXPLAIN.md"}'),o={name:"docs/7x/ref_guide/sql_commands/EXPLAIN.md"};function i(p,e,l,r,c,d){return n(),s("div",null,e[0]||(e[0]=[t(`<h1 id="explain" tabindex="-1">EXPLAIN <a class="header-anchor" href="#explain" aria-label="Permalink to &quot;EXPLAIN&quot;">​</a></h1><p>Shows the query plan of a statement.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>EXPLAIN [ ( &lt;option&gt; [, ...] ) ] &lt;statement&gt;</span></span>
<span class="line"><span>EXPLAIN [ANALYZE] [VERBOSE] &lt;statement&gt;</span></span></code></pre></div><p>where option can be one of:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>    ANALYZE [ &lt;boolean&gt; ]</span></span>
<span class="line"><span>    VERBOSE [ &lt;boolean&gt; ]</span></span>
<span class="line"><span>    COSTS [ &lt;boolean&gt; ]</span></span>
<span class="line"><span>    BUFFERS [ &lt;boolean&gt; ]</span></span>
<span class="line"><span>    TIMING [ &lt;boolean&gt; ]</span></span>
<span class="line"><span>    FORMAT { TEXT | XML | JSON | YAML }</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>EXPLAIN</code> displays the query plan that the WarehousePG or Postgres-based planner generates for the supplied statement. Query plans are a tree plan of nodes. Each node in the plan represents a single operation, such as table scan, join, aggregation or a sort.</p><p>Plans should be read from the bottom up as each node feeds rows into the node directly above it. The bottom nodes of a plan are usually table scan operations (sequential, index or bitmap index scans). If the query requires joins, aggregations, or sorts (or other operations on the raw rows) then there will be additional nodes above the scan nodes to perform these operations. The topmost plan nodes are usually the WarehousePG motion nodes (redistribute, explicit redistribute, broadcast, or gather motions). These are the operations responsible for moving rows between the segment instances during query processing.</p><p>The output of <code>EXPLAIN</code> has one line for each node in the plan tree, showing the basic node type plus the following cost estimates that the planner made for the execution of that plan node:</p><ul><li><strong>cost</strong> — the planner&#39;s guess at how long it will take to run the statement (measured in cost units that are arbitrary, but conventionally mean disk page fetches). Two cost numbers are shown: the start-up cost before the first row can be returned, and the total cost to return all the rows. Note that the total cost assumes that all rows will be retrieved, which may not always be the case (if using <code>LIMIT</code> for example).</li><li><strong>rows</strong> — the total number of rows output by this plan node. This is usually less than the actual number of rows processed or scanned by the plan node, reflecting the estimated selectivity of any <code>WHERE</code> clause conditions. Ideally the top-level nodes estimate will approximate the number of rows actually returned, updated, or deleted by the query.</li><li><strong>width</strong> — total bytes of all the rows output by this plan node.</li></ul><p>It is important to note that the cost of an upper-level node includes the cost of all its child nodes. The topmost node of the plan has the estimated total execution cost for the plan. This is this number that the planner seeks to minimize. It is also important to realize that the cost only reflects things that the query optimizer cares about. In particular, the cost does not consider the time spent transmitting result rows to the client.</p><p><code>EXPLAIN ANALYZE</code> causes the statement to be actually run, not only planned. The <code>EXPLAIN ANALYZE</code> plan shows the actual results along with the planner&#39;s estimates. This is useful for seeing whether the planner&#39;s estimates are close to reality. In addition to the information shown in the <code>EXPLAIN</code> plan, <code>EXPLAIN ANALYZE</code> will show the following additional information:</p><ul><li><p>The total elapsed time (in milliseconds) that it took to run the query.</p></li><li><p>The number of <em>workers</em> (segments) involved in a plan node operation. Only segments that return rows are counted.</p></li><li><p>The maximum number of rows returned by the segment that produced the most rows for an operation. If multiple segments produce an equal number of rows, the one with the longest <em>time to end</em> is the one chosen.</p></li><li><p>The segment id number of the segment that produced the most rows for an operation.</p></li><li><p>For relevant operations, the work_mem used by the operation. If <code>work_mem</code> was not sufficient to perform the operation in memory, the plan will show how much data was spilled to disk and how many passes over the data were required for the lowest performing segment. For example:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>Work_mem used: 64K bytes avg, 64K bytes max (seg0).</span></span>
<span class="line"><span>Work_mem wanted: 90K bytes avg, 90K bytes max (seg0) to abate workfile </span></span>
<span class="line"><span>I/O affecting 2 workers.</span></span>
<span class="line"><span>[seg0] pass 0: 488 groups made from 488 rows; 263 rows written to </span></span>
<span class="line"><span>workfile</span></span>
<span class="line"><span>[seg0] pass 1: 263 groups made from 263 rows</span></span></code></pre></div></li><li><p>The time (in milliseconds) it took to retrieve the first row from the segment that produced the most rows, and the total time taken to retrieve all rows from that segment. The <em>&lt;time&gt; to first row</em> may be omitted if it is the same as the <em>&lt;time&gt; to end</em>.</p></li></ul><blockquote><p><strong>Important</strong> Keep in mind that the statement is actually run when <code>ANALYZE</code> is used. Although <code>EXPLAIN ANALYZE</code> will discard any output that a <code>SELECT</code> would return, other side effects of the statement will happen as usual. If you wish to use <code>EXPLAIN ANALYZE</code> on a DML statement without letting the command affect your data, use this approach:</p></blockquote><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>BEGIN;</span></span>
<span class="line"><span>EXPLAIN ANALYZE ...;</span></span>
<span class="line"><span>ROLLBACK;</span></span></code></pre></div><p>Only the <code>ANALYZE</code> and <code>VERBOSE</code> options can be specified, and only in that order, without surrounding the option list in parentheses.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>ANALYZE : Carry out the command and show the actual run times and other statistics. This parameter defaults to <code>FALSE</code> if you omit it; specify <code>ANALYZE true</code> to enable it.</p><p>VERBOSE : Display additional information regarding the plan. Specifically, include the output column list for each node in the plan tree, schema-qualify table and function names, always label variables in expressions with their range table alias, and always print the name of each trigger for which statistics are displayed. This parameter defaults to <code>FALSE</code>if you omit it; specify <code>VERBOSE true</code> to enable it.</p><p>COSTS : Include information on the estimated startup and total cost of each plan node, as well as the estimated number of rows and the estimated width of each row. This parameter defaults to <code>TRUE</code> if you omit it; specify <code>COSTS false</code> to deactivate it.</p><p>BUFFERS : Include information on buffer usage. This parameter may be specified only when <code>ANALYZE</code> is also specified. If omitted, the default value is <code>false</code>, buffer usage information is not included.</p><blockquote><p><strong>Note</strong> WarehousePG does not support specifying <code>BUFFERS [true]</code> for distributed queries; ignore any displayed buffer usage information.</p></blockquote><p>TIMING : Include actual startup time and time spent in each node in the output. The overhead of repeatedly reading the system clock can slow down the query significantly on some systems, so it may be useful to set this parameter to <code>FALSE</code> when only actual row counts, and not exact times, are needed. Run time of the entire statement is always measured, even when node-level timing is turned off with this option. This parameter may only be used when <code>ANALYZE</code> is also enabled. It defaults to <code>TRUE</code>.</p><p>FORMAT : Specify the output format, which can be <code>TEXT</code>, <code>XML</code>, <code>JSON</code>, or <code>YAML</code>. Non-text output contains the same information as the text output format, but is easier for programs to parse. This parameter defaults to <code>TEXT</code>.</p><p>boolean : Specifies whether the selected option should be turned on or off. You can write <code>TRUE</code>, <code>ON</code>, or <code>1</code> to enable the option, and <code>FALSE</code>, <code>OFF</code>, or <code>0</code> to deactivate it. The boolean value can also be omitted, in which case <code>TRUE</code> is assumed.</p><p>statement : Any <code>SELECT</code>, <code>INSERT</code>, <code>UPDATE</code>, <code>DELETE</code>, <code>VALUES</code>, <code>EXECUTE</code>, <code>DECLARE</code>, or <code>CREATE TABLE AS</code> statement, whose execution plan you wish to see.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>In order to allow the query optimizer to make reasonably informed decisions when optimizing queries, the <code>ANALYZE</code> statement should be run to record statistics about the distribution of data within the table. If you have not done this (or if the statistical distribution of the data in the table has changed significantly since the last time <code>ANALYZE</code> was run), the estimated costs are unlikely to conform to the real properties of the query, and consequently an inferior query plan may be chosen.</p><p>An SQL statement that is run during the execution of an <code>EXPLAIN ANALYZE</code> command is excluded from WarehousePG resource queues.</p><p>For more information about query profiling, see &quot;Query Profiling&quot; in the <em>WarehousePG Administrator Guide</em>. For more information about resource queues, see &quot;Resource Management with Resource Queues&quot; in the <em>WarehousePG Administrator Guide</em>.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To illustrate how to read an <code>EXPLAIN</code> query plan, consider the following example for a very simple query:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>EXPLAIN SELECT * FROM names WHERE name = &#39;Joelle&#39;;</span></span>
<span class="line"><span>                                  QUERY PLAN</span></span>
<span class="line"><span>-------------------------------------------------------------------------------</span></span>
<span class="line"><span> Gather Motion 3:1  (slice1; segments: 3)  (cost=0.00..431.27 rows=1 width=58)</span></span>
<span class="line"><span>   -&gt;  Seq Scan on names  (cost=0.00..431.27 rows=1 width=58)</span></span>
<span class="line"><span>         Filter: (name = &#39;Joelle&#39;::text)</span></span>
<span class="line"><span> Optimizer: GPORCA</span></span>
<span class="line"><span>(4 rows)</span></span></code></pre></div><p>If we read the plan from the bottom up, the query optimizer starts by doing a sequential scan of the <code>names</code> table. Notice that the <code>WHERE</code> clause is being applied as a <em>filter</em> condition. This means that the scan operation checks the condition for each row it scans, and outputs only the ones that pass the condition.</p><p>The results of the scan operation are passed up to a <em>gather motion</em> operation. In WarehousePG, a gather motion is when segments send rows up to the coordinator. In this case we have 3 segment instances sending to 1 coordinator instance (3:1). This operation is working on <code>slice1</code> of the parallel query execution plan. In WarehousePG a query plan is divided into <em>slices</em> so that portions of the query plan can be worked on in parallel by the segments.</p><p>The estimated startup cost for this plan is <code>00.00</code> (no cost) and a total cost of <code>431.27</code>. The planner is estimating that this query will return one row.</p><p>Here is the same query, with cost estimates suppressed:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>EXPLAIN (COSTS FALSE) SELECT * FROM names WHERE name = &#39;Joelle&#39;;</span></span>
<span class="line"><span>                QUERY PLAN</span></span>
<span class="line"><span>------------------------------------------</span></span>
<span class="line"><span> Gather Motion 3:1  (slice1; segments: 3)</span></span>
<span class="line"><span>   -&gt;  Seq Scan on names</span></span>
<span class="line"><span>         Filter: (name = &#39;Joelle&#39;::text)</span></span>
<span class="line"><span> Optimizer: GPORCA</span></span>
<span class="line"><span>(4 rows)</span></span></code></pre></div><p>Here is the same query, with JSON formatting:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>EXPLAIN (FORMAT JSON) SELECT * FROM names WHERE name = &#39;Joelle&#39;;</span></span>
<span class="line"><span>                  QUERY PLAN</span></span>
<span class="line"><span>-----------------------------------------------</span></span>
<span class="line"><span> [                                            +</span></span>
<span class="line"><span>   {                                          +</span></span>
<span class="line"><span>     &quot;Plan&quot;: {                                +</span></span>
<span class="line"><span>       &quot;Node Type&quot;: &quot;Gather Motion&quot;,          +</span></span>
<span class="line"><span>       &quot;Senders&quot;: 3,                          +</span></span>
<span class="line"><span>       &quot;Receivers&quot;: 1,                        +</span></span>
<span class="line"><span>       &quot;Slice&quot;: 1,                            +</span></span>
<span class="line"><span>       &quot;Segments&quot;: 3,                         +</span></span>
<span class="line"><span>       &quot;Gang Type&quot;: &quot;primary reader&quot;,         +</span></span>
<span class="line"><span>       &quot;Startup Cost&quot;: 0.00,                  +</span></span>
<span class="line"><span>       &quot;Total Cost&quot;: 431.27,                  +</span></span>
<span class="line"><span>       &quot;Plan Rows&quot;: 1,                        +</span></span>
<span class="line"><span>       &quot;Plan Width&quot;: 58,                      +</span></span>
<span class="line"><span>       &quot;Plans&quot;: [                             +</span></span>
<span class="line"><span>         {                                    +</span></span>
<span class="line"><span>           &quot;Node Type&quot;: &quot;Seq Scan&quot;,           +</span></span>
<span class="line"><span>           &quot;Parent Relationship&quot;: &quot;Outer&quot;,    +</span></span>
<span class="line"><span>           &quot;Slice&quot;: 1,                        +</span></span>
<span class="line"><span>           &quot;Segments&quot;: 3,                     +</span></span>
<span class="line"><span>           &quot;Gang Type&quot;: &quot;primary reader&quot;,     +</span></span>
<span class="line"><span>           &quot;Relation Name&quot;: &quot;names&quot;,          +</span></span>
<span class="line"><span>           &quot;Alias&quot;: &quot;names&quot;,                  +</span></span>
<span class="line"><span>           &quot;Startup Cost&quot;: 0.00,              +</span></span>
<span class="line"><span>           &quot;Total Cost&quot;: 431.27,              +</span></span>
<span class="line"><span>           &quot;Plan Rows&quot;: 1,                    +</span></span>
<span class="line"><span>           &quot;Plan Width&quot;: 58,                  +</span></span>
<span class="line"><span>           &quot;Filter&quot;: &quot;(name = &#39;Joelle&#39;::text)&quot;+</span></span>
<span class="line"><span>         }                                    +</span></span>
<span class="line"><span>       ]                                      +</span></span>
<span class="line"><span>     },                                       +</span></span>
<span class="line"><span>     &quot;Settings&quot;: {                            +</span></span>
<span class="line"><span>       &quot;Optimizer&quot;: &quot;Pivotal Optimizer (GPORCA) version 3.23.0&quot;      +</span></span>
<span class="line"><span>     }                                        +</span></span>
<span class="line"><span>   }                                          +</span></span>
<span class="line"><span> ]</span></span>
<span class="line"><span>(1 row)</span></span></code></pre></div><p>If there is an index and we use a query with an indexable <code>WHERE</code> condition, <code>EXPLAIN</code> might show a different plan. This query generates a plan with an index scan, with YAML formatting:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>EXPLAIN (FORMAT YAML) SELECT * FROM NAMES WHERE LOCATION=&#39;Sydney, Australia&#39;;</span></span>
<span class="line"><span>                          QUERY PLAN</span></span>
<span class="line"><span>--------------------------------------------------------------</span></span>
<span class="line"><span> - Plan:                                                     +</span></span>
<span class="line"><span>     Node Type: &quot;Gather Motion&quot;                              +</span></span>
<span class="line"><span>     Senders: 3                                              +</span></span>
<span class="line"><span>     Receivers: 1                                            +</span></span>
<span class="line"><span>     Slice: 1                                                +</span></span>
<span class="line"><span>     Segments: 3                                             +</span></span>
<span class="line"><span>     Gang Type: &quot;primary reader&quot;                             +</span></span>
<span class="line"><span>     Startup Cost: 0.00                                      +</span></span>
<span class="line"><span>     Total Cost: 10.81                                       +</span></span>
<span class="line"><span>     Plan Rows: 10000                                        +</span></span>
<span class="line"><span>     Plan Width: 70                                          +</span></span>
<span class="line"><span>     Plans:                                                  +</span></span>
<span class="line"><span>       - Node Type: &quot;Index Scan&quot;                             +</span></span>
<span class="line"><span>         Parent Relationship: &quot;Outer&quot;                        +</span></span>
<span class="line"><span>         Slice: 1                                            +</span></span>
<span class="line"><span>         Segments: 3                                         +</span></span>
<span class="line"><span>         Gang Type: &quot;primary reader&quot;                         +</span></span>
<span class="line"><span>         Scan Direction: &quot;Forward&quot;                           +</span></span>
<span class="line"><span>         Index Name: &quot;names_idx_loc&quot;                         +</span></span>
<span class="line"><span>         Relation Name: &quot;names&quot;                              +</span></span>
<span class="line"><span>         Alias: &quot;names&quot;                                      +</span></span>
<span class="line"><span>         Startup Cost: 0.00                                  +</span></span>
<span class="line"><span>         Total Cost: 7.77                                    +</span></span>
<span class="line"><span>         Plan Rows: 10000                                    +</span></span>
<span class="line"><span>         Plan Width: 70                                      +</span></span>
<span class="line"><span>         Index Cond: &quot;(location = &#39;Sydney, Australia&#39;::text)&quot;+</span></span>
<span class="line"><span>   Settings:                                                 +</span></span>
<span class="line"><span>     Optimizer: &quot;Pivotal Optimizer (GPORCA) version 3.23.0&quot;</span></span>
<span class="line"><span>(1 row)</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>There is no <code>EXPLAIN</code> statement defined in the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ANALYZE.html">ANALYZE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,48)]))}const m=a(o,[["render",i]]);export{h as __pageData,m as default};
